import React from 'react';
import { Switch, Route } from 'react-router-dom';
import LandingPage from './landingpage';
import Plan from './plan';

const Main = () => (
	<Switch>
		<Route exact path="/" component={LandingPage} />
		<Route path="/plans" component={Plan} />
	</Switch>
);

export default Main;
